# 
#  # List of worlds where xp bars should be enabled
#  enabled_worlds:
#    - world
#    - world_nether
#    - world_the_end
#  # Whether to save the config file every time a setting is updated.
#  # When false, the config file will only be updated when the server shuts down or /xpbarsave is used.
#  save_data_on_modify: false
#  # Whether xp bars are enabled for all players by default
#  xp_bar_default_enabled: true
#  # The default number of seconds xp bars will stay on screen for
#  xp_bar_default_timeout: 10
#  # The default number of xp bars that can be displayed at once
#  xp_bar_default_count: 2
#  # The default style for xp bars, choose the number of segments from 1/6/10/12/20
#  xp_bar_default_style: 1
#  # The default color for xp bars, choose from pink/blue/red/green/yellow/purple/white
#  xp_bar_default_color: green
#  # The maximum time in seconds that players may set their timeout to
#  xp_bar_max_timeout: 30
#  # The message to display above xp bars, use '&' for formatting codes and you can use the special phrases below to insert relevent text.
#  # $skillname$: name of skill (uses MCMMO's localized names)
#  # $skillcurrentlevel$: current level in the skill
#  # $skillnextlevel$: the next level in the skill
#  # $xpcurrent$: amount of xp earned since the start of this level
#  # $xpatlevelup$: amount of xp required to go from the start of the current level to the next level
#  # $xpgained$: amount of xp that was most recently gained from an action
#  # $xpbefore$: amount of xp earned since the start of this level, not including the xp most recently gained
#  # $xpremaining$: amount of xp remaining until the next level is reached
#  # $progresspercent$: "__%" of the progress towards the next level
#  xp_bar_message: '$skillname$ (Level $skillcurrentlevel$ : $xpcurrent$/$xpatlevelup$)'
#  #xp_bar_message: $skillname$ - $xpremaining$xp until level $skillnextlevel$ [+$xpgained$]
settings:
  enabled_worlds:
  - Bouquenia_the_end
  - Bouquenia_nether
  - skyworld_nether
  - Bouquenia
  - skyworld
  - Pitman
  save_data_on_modify: false
  xp_bar_default_enabled: true
  xp_bar_default_timeout: 10
  xp_bar_default_count: 2
  xp_bar_default_style: 10
  xp_bar_default_color: purple
  xp_bar_max_timeout: 30
  xp_bar_message: '&6$skillname$ &7(Niveau $skillcurrentlevel$ : $xpcurrent$/$xpatlevelup$)'
